import logo from './logo.svg';
import './App.css';
import posts from './posts.json';
import { useEffect } from 'react';

function App() {



  return (

    <div className="App"> 
      <slider>
        {posts.forEach(element => {
          return (
            <div>
              <h1>{element.title}</h1>
              <img src={element.image} alt="slay"/>
              <p>{element.description}</p>
            </div>
          )
        })}
      </slider>
    </div>
  );
}

export default App;
